import './App.css';
import Navc from "./component/Navc";
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (
  <>

   <Navc/>
   <Routes>
      <Route path="/" element={<Home />} />
      <Route path="home" element={<Home />} />
      <Route path="login" element={<Login />} />
      <Route path="cart" element={<Cart />} />
      <Route path="productview" element={<Productview imgsrc="https://m.media-amazon.com/images/I/71jG+e7roXL._AC_UL480_QL65_.jpg" />} />
    </Routes>

    </>
  )  
}

export default App;
